import React, { useEffect, useState } from 'react'
import CameraCapture from './components/CameraCapture'
import Chat from './Chat'

function uuidv4() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
    const r = (Math.random() * 16) | 0,
      v = c === 'x' ? r : (r & 0x3) | 0x8
    return v.toString(16)
  })
}

export default function App() {
  const [deviceId, setDeviceId] = useState(null)
  const [verified, setVerified] = useState(null)
  const [loading, setLoading] = useState(true)

  useEffect(() => {
    let id = localStorage.getItem('device_id')
    if (!id) {
      id = uuidv4()
      localStorage.setItem('device_id', id)
    }
    setDeviceId(id)
    setLoading(false)
  }, [])

  if (loading) {
    return (
      <div className="app-container">
        <div className="brand">
          <div style={{ width: 36, height: 36, borderRadius: 8, background: 'linear-gradient(90deg,#60a5fa,#5eead4)' }} />
          <div>
            <h1 style={{ margin: 0 }}>Anonymous Chat</h1>
            <div className="sub">Controlled Anonymity â€” demo</div>
          </div>
        </div>
        <div style={{ textAlign: 'center', color: '#9aa4b2', marginTop: 40 }}>
          Initializing...
        </div>
      </div>
    )
  }

  return (
    <div className="app-container">
      <div className="brand">
        <div style={{ width: 36, height: 36, borderRadius: 8, background: 'linear-gradient(90deg,#60a5fa,#5eead4)' }} />
        <div>
          <h1 style={{ margin: 0 }}>Anonymous Chat</h1>
          <div className="sub">Controlled Anonymity â€” demo</div>
        </div>
      </div>

      {deviceId ? (
        verified ? (
          <Chat deviceId={deviceId} profile={verified} />
        ) : (
          <div className="onboard-grid">
            <CameraCapture
              deviceId={deviceId}
              onVerified={(profile) => {
                console.log('Verified with profile:', profile)
                setVerified(profile)
              }}
            />
            <div className="card" style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center' }}>
              <h3 style={{ marginTop: 0 }}>Welcome</h3>
              <p style={{ color: '#9aa4b2', lineHeight: 1.6, margin: '0 0 16px 0' }}>
                ðŸŽ­ <strong>Controlled Anonymity</strong> lets you chat with matched strangers safely and respectfully.
              </p>
              <div style={{ fontSize: 13, color: '#9aa4b2' }}>
                <div style={{ marginBottom: 12 }}>
                  <strong style={{ color: '#5eead4' }}>ðŸ“¸ Camera Verification</strong>
                  <p style={{ margin: '4px 0 0 0' }}>Your selfie is verified for gender classification, then deleted immediately. No images are stored.</p>
                </div>
                <div style={{ marginBottom: 12 }}>
                  <strong style={{ color: '#5eead4' }}>ðŸ”’ Anonymous Profile</strong>
                  <p style={{ margin: '4px 0 0 0' }}>Create a nickname and bio without revealing your identity.</p>
                </div>
                <div style={{ marginBottom: 12 }}>
                  <strong style={{ color: '#5eead4' }}>ðŸŽ¯ Smart Matching</strong>
                  <p style={{ margin: '4px 0 0 0' }}>Join queues by preference. Daily limits apply to ensure fairness.</p>
                </div>
                <div>
                  <strong style={{ color: '#5eead4' }}>âš¡ Ephemeral Chat</strong>
                  <p style={{ margin: '4px 0 0 0' }}>Chats are temporary. No chat history is saved.</p>
                </div>
              </div>
            </div>
          </div>
        )
      ) : null}
    </div>
  )
}
